            lingagens: "PHP, js, HTML5, bootstrap, css3",
            img: "/images/radiocapa.png",
            site: "www.radioaguiafm.com.br" ,

        },
        {
            projeto: "Radio Agioa FM",
            lingagens: "PHP, js, HTML5, bootstrap, css3",
            img: "/images/radiocapa.png",
            site: "www.radioaguiafm.com.br" ,

        }
    ]

    return(
        <ContainerServices>
            {
                services.map((doc, index) => (
                    <Items>
                        {`${doc.projeto}`}
                        <img src={doc.img} alt="" />
                    </Items>
                ))
            }
        </ContainerServices>
    )
}
